const Dialer = require('dialer').Dialer
Dialer.call('555555555','555666777').then((call) => {
    let intervalId = setInterval(async () => {
        status = await call.getStatus()
        console.log(status)
        if(status == 'ANSWERED' || status === 'FAILED') {
            clearInterval(intervalId)
        }
    }, 500)
}).catch((e) => {
    console.log(e)
}) 

